pub mod genesis {
    //! Helper module to build a genesis configuration for the template runtime.
    use super::{
        kitties::{KittyData, Parent},
        money::Coin, OuterConstraintChecker, OuterVerifier, WASM_BINARY,
    };
    use hex_literal::hex;
    use tuxedo_core::{
        verifier::{Sr25519Signature, ThresholdMultiSignature, UpForGrabs},
        ConstraintChecker,
    };
    /// Helper type for the ChainSpec.
    pub type RuntimeGenesisConfig = tuxedo_core::genesis::TuxedoGenesisConfig<
        OuterVerifier,
        OuterConstraintChecker,
    >;
    const SHAWN_PUB_KEY_BYTES: [u8; 32] = {
        const STRINGS: &[&'static [u8]] = &[
            "d2bf4b844dfefd6772a8843e669f943408966a977e3ae2af1dd78e0f55f4df67".as_bytes(),
        ];
        const LEN: usize = ::hex_literal::len(STRINGS);
        const RES: [u8; LEN] = ::hex_literal::decode(STRINGS);
        RES
    };
    const ANDREW_PUB_KEY_BYTES: [u8; 32] = {
        const STRINGS: &[&'static [u8]] = &[
            "baa81e58b1b4d053c2e86d93045765036f9d265c7dfe8b9693bbc2c0f048d93a".as_bytes(),
        ];
        const LEN: usize = ::hex_literal::len(STRINGS);
        const RES: [u8; LEN] = ::hex_literal::decode(STRINGS);
        RES
    };
    pub fn development_genesis_config() -> RuntimeGenesisConfig {
        let signatories = <[_]>::into_vec(
            #[rustc_box]
            ::alloc::boxed::Box::new([
                SHAWN_PUB_KEY_BYTES.into(),
                ANDREW_PUB_KEY_BYTES.into(),
            ]),
        );
        let mut genesis_transactions = OuterConstraintChecker::genesis_transactions();
        genesis_transactions
            .extend([
                Coin::<0>::mint(100, Sr25519Signature::new(SHAWN_PUB_KEY_BYTES)),
                Coin::<0>::mint(100, ThresholdMultiSignature::new(1, signatories)),
                KittyData::mint(Parent::mom(), b"mother", UpForGrabs),
                KittyData::mint(Parent::dad(), b"father", UpForGrabs),
            ]);
        RuntimeGenesisConfig::new(
            WASM_BINARY.expect("Runtime WASM binary must exist.").to_vec(),
            genesis_transactions,
        )
    }
}
